void UserInterface::make_equation(Fl_Value_Input *o,int TYPE) {
  //std::cout<<"Type="<<TYPE<<std::endl;
  color_label(o,255);
  switch(TYPE){
    case 1:
      make_math(o,"+");
      break;
    case 2:
      make_math(o,"-");
      break;
    case 3:
      make_math(o,"");
      break;
    case 4:
      make_math(o,"x");
      break;
    case 0:
      break;
    default:
       o->copy_label(" ");
       o->value(0);
       return;
  }
}

