double UserInterface::generate_random() {
  double num = 0;
  switch(m_DIFFICULTY){
    case 1:
      num = rand()%10;
      break;
    case 2:
      num = rand()%25;
      break;
    case 3:
      num = rand()%50;
      break;
    case 4:
      num = rand()%75;
      break;
    case 5:
      num = rand()%100;
      break;
    default:
      num =  rand()%10;
  }
  return num;
}

